import React from "react";

const Error = () => {
  return (
    <div>
      <p>Error: Page does not exist!</p>
      <a className="btn btn-dark text-center mr-2 mt-2" href="/">
        Go back to home
      </a>
    </div>
  );
};

export default Error;
